import React from "react";
import AllArticles from "./AllArticles";
import HeaderBg from '../assets/img/Modublo.jpg'
import Header from "./Header";
function Blog(){
    return(
        <div>
            <Header img={HeaderBg} text="blabla"/>
            Blog
            <AllArticles/>
        </div>
    )
}

export default Blog;
